import React, { useState, useEffect } from 'react';
import { getEvents } from '../../fetch';

import BookingCalendar from 'react-booking-calendar';
import { CalendarWrapper, Container } from './hausboot-rot.styles';

const HausbootRot = () => {
	const [startDate, setStartDate] = useState([]);

	// const getDaysArray = function (start, end) {
	// 	for (var arr = [], dt = new Date(start); dt <= end; dt.setDate(dt.getDate() + 1)) {
	// 		arr.push(new Date(dt));
	// 	}
	// 	return arr;
	// };
	// const dayslist = getDaysArray(new Date('2021-05-01'), new Date('2021-05-06'));

	useEffect(() => {
		const fetchData = () => {
			getEvents((events) => setStartDate(events.map((event) => event.start)));
		};

		fetchData();
	}, []);

	const data = () => {
		for (let i = 0; i < startDate.length; i++) {
			new Date(startDate[i]);
		}
	};
	const bookings = [data];

	return (
		<div>
			<Container>
				<CalendarWrapper>
					<BookingCalendar bookings={bookings} disableHistory />
					<div>
						Test: {startDate}
						{
							console.log(data)
							// getEvents((events) => events.map((event) => console.log(event.start)))
						}
						{startDate.forEach((data) => console.log(new Date(data)))}
					</div>
				</CalendarWrapper>
			</Container>
		</div>
	);
};

export default HausbootRot;
